private InformaticaCassandraBulkLoader informaticaCassandraLoader;


//private InformaticaCassandraLoaderFactory informaticaCassandraLoaderFactory;
Map<String,String> rowMap;
int rowCount=0;

int numberOfRecordsInBatch=0;
int batchNumber=0;
int previousBatchNumber=-1;
String NEW_CASSANDRA_KEY="";

if (rowCount>0){

try{
logInfo("CLASSPATH");
logInfo(System.getenv("CLASSPATH"));
//informaticaCassandraBulkLoader.close();

informaticaCassandraLoader.loadData();

}
catch (Exception e)
{
logInfo(e.getMessage());
//throw new JTXFatalException(e.getMessage());
}

OUTPUT="0";
generateRow();
}

try{
if (informaticaCassandraLoader  == null)
{
logInfo("CASSANDRA_CONF");
//logInfo(System.getenv("CASSANDRA_CONF"));
//logInfo(System.getenv("CASSANDRA_BULK_LOAD_DIR"));

logInfo("CreateLoader");

if (rowMap== null)
{
logInfo("RowMap created");
rowMap= new HashMap<String,String>();
}




informaticaCassandraLoader = new InformaticaCassandraBulkLoader(ACG_ROOT_CLUSTER,ACG_ROOT,KEYSPACE_NAME,COLUMN_FAMILY_NAME,true);
informaticaCassandraLoader.setCreateCSVOnly(true);

logInfo("loader Created");
logInfo(informaticaCassandraLoader.getColumnFamilyName());

logInfo("CF NAME");
logInfo(informaticaCassandraLoader.getColumnFamilyName());

logInfo("KS NAME");
logInfo(informaticaCassandraLoader.getKeyspaceName());


logInfo("Rcount is:"+String.valueOf(rCount));

numberOfRecordsInBatch=rCount/20;
logInfo(String.valueOf(numberOfRecordsInBatch));


}
//logInfo("Create rowMap");

//logInfo(TicketReferenceNumber);
//logInfo(contactID);


//logInfo("3");
rowCount++;
batchNumber = Integer.valueOf(rowCount/numberOfRecordsInBatch).intValue();
if (batchNumber!=previousBatchNumber){
  if (previousBatchNumber==-1){
      previousBatchNumber=batchNumber;
      NEW_CASSANDRA_KEY=CASSANDRA_KEY+String.valueOf(previousBatchNumber);
      logInfo("0 previous key NEW_CASSANDRA_KEY:"+NEW_CASSANDRA_KEY);
	logInfo(String.valueOf(rowCount));
  } else{
previousBatchNumber=batchNumber;
      NEW_CASSANDRA_KEY=CASSANDRA_KEY+String.valueOf(previousBatchNumber);
      logInfo("NEW_CASSANDRA_KEY:"+NEW_CASSANDRA_KEY);

  }
}
rowMap= new HashMap<String,String>();


rowMap.put("Monitor",String.valueOf(SUPERCOLUMN_COLUMN));


informaticaCassandraLoader.loadRow(NEW_CASSANDRA_KEY,String.valueOf((DateTS/Long.valueOf(1000))-Long.valueOf(3600)),0L,rowMap);


if (rowCount%10000==0){
logInfo(String.valueOf(rowCount));
logInfo(SUPERCOLUMN_COLUMN);
logInfo(CASSANDRA_KEY+String.valueOf(previousBatchNumber));
}

}
catch (Exception e)
{
logError("exception");
failSession("ERROR");
}

